// EvergageUserProvider consumption
var UserProviderFactory = (function() {

    var API = {},
        finalFieldValue;

    function isPlainTextEmail(email) {
        var Rgx = /^[A-Za-z0-9&\+\'_-]+(\.[A-Za-z0-9&\+\'_-]+)*@([A-Za-z0-9_-]+\.)+[A-Za-z]{2,6}$/i
        return Rgx.exec(email);
    }

    function isUserKey(text) {
        return (text && text === "userID" || text === "userId" || text === "userid");
    }

    function isFirstName(text) {
        return (text && text === "firstName");
    }

    function isUserEmailKey(text) {
        return (text && text === "email" || text === "emailHash" || text === "Email");
    }

    function isSegmentCodes(text) {
        return (text && text === "SegmentMembership" || text === "segmentMembership");
    }

    function isPropertyMembership(text) {
        return (text && (text === "PropertyMembership" || text === "propertyMembership"));
    }

    function isGeneralField(text) {
        return (!isUserKey(text) && !isSegmentCodes(text) && !isPropertyMembership(text) && !isUserEmailKey(text));
    }

    function isNotHashedEmptyString(text) {
        return (Tools.md5(text) !== "d41d8cd98f00b204e9800998ecf8427e")
    }

    function handleSetUser(email, GMT) {

        /** 
         *   clearText will return as a string of the setUser call value if user is 
         *   unrecognized or the userId does not correspond to a known _persistedUserId
         */
        var clearTextUserId = Evergage.getUser();
        /**
         *   _persistedUserId returns as string if user is recognized, false if not.
         */
        var persistedUserId = Evergage.getCustomField("_persistedUserId");
        var finalUserId;

        if (clearTextUserId === false && persistedUserId === false) {
            // Totally unrecognized to evergage
            Tools.log('dev', 'userId is not recognized, no _persistedId. [userId] ' + email);
            finalUserId = email;
        } else if (clearTextUserId === false && Tools.isValidString(persistedUserId)) {
            // Recognized, good setUser Call
            Tools.log('dev', 'userId is recognized, matches defined schema. [userId] ' + email);
            finalUserId = email;
        }

        // setUser call is bad, doesn't look like an md5 hash
        // TODO: Md5 regex check

        if (Tools.isValidString(clearTextUserId) && clearTextUserId.length !== 32) {

            Tools.log('dev', 'setUser called with invalid value (longer/shorter than 32 char md5). [userId] ' + email);
            // clear visit scope user data from cookie
            Evergage.deleteCustomField("userId", "VISIT");
            Evergage.deleteCustomField("_persistedUserId", "VISIT");

            if (isPlainTextEmail(email)) {
                finalUserId = Tools.md5(email);
            } else if (!isPlainTextEmail(email) && isNotHashedEmptyString(email)) {
                Tools.log('dev', 'Calling setUser with: [userId] ' + email);
                finalUserId = email;
            }

        } else if (Tools.isValidString(clearTextUserId) && clearTextUserId.length === 32 && clearTextUserId.toLowerCase() !== email.toLowerCase()) {
            Tools.log('dev', 'setUser called with valid md5, it is different from whats stored. Sending in [userId] ' + email);
            finalUserId = email;
        }

        if (Tools.isValidString(GMT)) {
            if (finalUserId) {
                if (collect.userId) Tools.collectSingleField('userId', finalUserId);
            }
            // Since the hashed email went up as userId, we send in the GMT as it's own custom field
            if (collect.globalMemberToken) Tools.collectSingleField('GMT', GMT);
        }
        return;

    }

    function handleUserName(provider) {

        var fullName = provider.firstName + ' ' + provider.lastName;
        if (Tools.isValidString(fullName)) {
            Tools.collectSingleField('userName', fullName);
        }

    }

    // set userEmail as well with the same md5 hash we called setUser with
    function handleUserEmail(fieldValue) {
        var finalEmailValue;
        if (isPlainTextEmail(fieldValue)) {
            finalEmailValue = md5(fieldValue.trim().toLowerCase());
        } else if (!isPlainTextEmail(fieldValue) && isNotHashedEmptyString(fieldValue)) {
            finalEmailValue = fieldValue.trim();
        }
        if (finalEmailValue) {
            Tools.collectSingleField('userEmail', finalEmailValue);
        }
    }

    // identify & handle inconsistencies in the segment array (e.g var Array = [['ab','poc2']];)
    function handleSegmentCodes(fieldValue) {
        var finalSegmentMembership;
        if (typeof fieldValue === "object" && fieldValue.length === 1 && typeof fieldValue[0] === "string") {
            finalSegmentMembership = fieldValue[0].trim().split(',').sort();
        } else if (typeof fieldValue === "string") {
            finalSegmentMembership = fieldValue.trim().split(',').sort();
        } else if (typeof fieldValue === "object" && fieldValue.length === 1 && typeof fieldValue[0] === "object" && fieldValue[0].length > 0) {
            finalSegmentMembership = fieldValue[0].sort()
        } else if (typeof fieldValue === "object" && fieldValue.length > 1) {
            finalSegmentMembership = fieldValue
        }
        if (finalSegmentMembership) {
            Tools.collectSingleField('SegmentMembership', String(finalSegmentMembership));
        }
    }

    // Collect property membership as comma seperated for good measure
    function handlePropertyMembership(fieldValue) {
        var finalPropertyMembership;
        if (typeof fieldValue === "object" && typeof fieldValue.length === "number") {
            finalPropertyMembership = String(fieldValue);
        } else if (typeof fieldValue === "string" && fieldValue !== "") {
            finalPropertyMembership = fieldValue;
        }
        if (finalPropertyMembership) {
            Tools.collectSingleField('propertyMembership', finalPropertyMembership);
        }
    }

    function handleGeneralFields(fieldName, fieldValue) {
        var finalGeneralField;
        if (typeof fieldValue === "string") {
            finalGeneralField = fieldValue.trim();
        } else if (typeof fieldValue === "number") {
            finalGeneralField = String(fieldValue);
        }

        if (finalGeneralField) {
            Tools.collectSingleField(fieldName, finalGeneralField);
        }

    }

    function populateEmergencyProvider() {
        if (window.PCHUSER && typeof window.PCHUSER === "object") {
            var d_ = window.PCHUSER;
            return {
                userID: d_.gmt,
                email: d_.emailHash,
                title: d_.title,
                fullName: d_.fullname,
                firstName: d_.firstName,
                lastName: d_.lastName,
                age: d_.age,
                state: d_.state,
                propertyMembership: d_.registrations,
                segmentMembership: d_.segments,
                daysSinceLastEntry: 0
            };
        }
    }

    // Is the provider defined, and populated with atleast a valid userId
    API.qualify = function(providerRef, callback) {

        if (providerRef.userID === "" && Tools.defineProperty() === "PCHCOM") {
            populateEmergencyProvider(function(result) {
                providerRef = result;
            });
        }

        if (!providerRef || typeof providerRef !== 'object' || typeof providerRef.userID == "") {
            callback();
        } else if (providerRef && typeof providerRef === 'object') {
            callback(providerRef);
        }
    };

    // Handle certain fields with special consideration
    API.handleBaseProfile = function(user) {
        for (var attribute in user) {
            if (user.hasOwnProperty(attribute)) {

                var fieldName = attribute;
                var fieldValue = user[attribute];
                if (isUserKey(fieldName) && Tools.isValidString(fieldValue)) {

                    handleSetUser(user.email, user[fieldName]);

                } else if (isFirstName(fieldName)) {
                    // pass the entire user in so we can get firstName and lastName from the utility
                    handleUserName(user);

                } else if (isSegmentCodes(fieldName)) {

                    if (collect.segmentMembership && fieldValue !== null) {
                        handleSegmentCodes(fieldValue);
                    } else if (collect.segmentMembership && fieldValue == null) {
                        handleSegmentCodes([]);
                    }

                } else if (isPropertyMembership(fieldName)) {
                    if (collect.propertyMembership) handlePropertyMembership(fieldValue);
                } else if (isUserEmailKey(fieldName)) {
                    if (collect.userEmail) handleUserEmail(fieldValue);
                } else if (isGeneralField(fieldName)) {
                    if (collect.generalFields) handleGeneralFields(fieldName, fieldValue);
                }
            }
        }
    };
    return API;

})();

// Dynamically Builds and Tracks Actions for TV Path Rotations
var AutoActionTracker = (function() {

    var API = {};

    function isMayTv() {
        var pathName = window.pathData.Name.toLowerCase();
        if (pathName.indexOf('may') > -1) {
            return true;
        } else {
            return false;
        }
    }

    // Spectrum TV Utilities
    function detectTvAcquisitionPath(callback) {

        var pathName = window.pathData.Name.toLowerCase(),
            promotionName;

        if (pathName.indexOf('may') > -1) {
            promotionName = pathName.slice(0, 9);
        } else if (pathName.indexOf('july') > -1) {
            promotionName = pathName.slice(0, 10);
        }

        var isTvPath = (pathName.indexOf('tv') > -1);
        var stepName = window.pathData.CurrentStep.Name.toLowerCase();

        if (isTvPath) {
            callback(promotionName, stepName, isMayTv);
        } else {
            Tools.log('prod', 'Did not detect TV acquisition path. Not tracking view for this pageload.');
            return;
        }

    }

    // Todo: This needs to goto Tools and instead we should have an additional first event object for just actions
    function holdActionForPageReady(actionName) {
        ajq(document).ready(function() {
            Evergage.trackAction(actionName);
        });
    }

    function getGroupNameAndLineUpIndex(pathId, qualifiedLocations) {

        var currentLineUpStep,
            groupName;

        for (var url in qualifiedLocations) {

            if (qualifiedLocations.hasOwnProperty(url)) {

                var locations = qualifiedLocations[url];
                for (var i = 0; i < locations.length; i++) {
                    // grab the locations for the current url 'ex: desktop_paidBuyers_mer'
                    var loc = locations[i].toLowerCase();
                    if (loc === pathId) {
                        groupName = url;
                        currentLineUpStep = i + 1;
                    }
                }
                if (typeof currentLineUpStep === "number") {

                    var groupNameArray = groupName.split('_'),
                        finalGroupName;

                    var groupGender;

                    if (groupNameArray.length == 3) {
                        finalGroupName = groupName.slice(0, groupName.length - 2);
                    } else if (groupNameArray.length == 4) {
                        // if the path is gender specific, the array has a 3rd value with the flag
                        finalGroupName = groupName.slice(0, groupName.length - 4);
                        groupGender = groupNameArray[3];
                    }

                    if (isMayTv()) {
                        finalGroupName = groupName;
                    }

                    if (!finalGroupName) return;

                    // split the 1x / 2x identifier out of the group name
                    var groupId = parseInt(groupName.split('_')[2]);
                    // split the device type from the group name
                    var groupDevice = groupName.split('_')[0];

                    var packageId;

                    var pathNameSliceSize;

                    switch (groupDevice) {
                        case 'desktop':
                            pathNameSliceSize = 15;
                            break;
                        case 'mobile':
                            pathNameSliceSize = 18;
                            break;
                    }

                    switch (groupId) {
                        case 1:
                            packageId = window.pathData.Name.slice(pathNameSliceSize).slice(0, 4);
                            break;
                        case 2:
                            packageId = window.pathData.Name.slice(pathNameSliceSize);
                            break;
                    }

                    if (packageId) {
                        var _packageId = packageId.toLowerCase();
                    }

                    return {
                        group: finalGroupName,
                        groupId: groupId,
                        groupGender: groupGender,
                        packageId: _packageId,
                        currentStep: currentLineUpStep
                    };
                }
            }

        }

    }

    function buildMayTvActionName(viewData) {
        return 'spec-view-' + viewData.group + '_' + viewData.currentStep;
    }

    function buildJulyTvActionName(viewData) {
        var actionName;
        if (viewData.groupGender) {
            actionName = 'spec-view-' + viewData.group + '_' + viewData.groupGender + '_' + viewData.packageId + '_' + viewData.groupId;
        } else {
            actionName = 'spec-view-' + viewData.group + '_' + viewData.packageId + '_' + viewData.groupId;
        }
        return actionName;
    }

    // Property Handling Call for Spectrum

    API.handleSpectrumTV = function(pathData, tvPromotionId) {

        detectTvAcquisitionPath(function(promotionName, currentStepName, isMayTv) {

            var viewData = getGroupNameAndLineUpIndex(currentStepName, opts.SpectrumTV[promotionName]),
                viewActionName;

            if (viewData && typeof viewData === "object") {
                if (isMayTv() === true) {
                    viewActionName = buildMayTvActionName(viewData);
                } else if (!isMayTv()) {
                    viewActionName = buildJulyTvActionName(viewData);
                }
            }

            if (viewActionName && typeof viewActionName === "string") {
                holdActionForPageReady(viewActionName);
            }

        });

    };

    // Property Handling Call for Mobile Lotto

    API.handleMobileLotto = function() {
        ajq('.splash-page>img').on({
            touchstart: function() {
                Evergage.hideAllMessages();
                Evergage.trackAction('PCHLotto-Mobile-Click-SplashStartNow');
            }
        });
        ajq('.splash-page').on({
            touchstart: function() {
                Evergage.hideAllMessages();
                Evergage.trackAction('PCHLotto-Mobile-Click-SplashPageModal');
            }
        });
    };

    return API;

})();


// Mini-Promote, Order & Revenue
var CommerceTracker = (function() {

    var API = {},
        desktopTools = {},
        mobileTools = {},
        orderData = [];

    function collectCartSize() {
        var cartSize = SpectrumUtils.GetCart().Items.length;
        Tools.collectSingleField('Spectrum_EoCartSize', String(cartSize));
    }

    function calculateTotalCartValue(items, callback) {
        if (!items) return;
        var totalValue = 0;
        for (var item = 0; item < items.length; item++) {
            orderData.push({
                price: items[item].Price,
                quantity: items[item].Quantity
            });
        }
        for (i = 0; i < orderData.length; i++) {
            totalValue = totalValue + orderData[i].price * orderData[i].quantity;
        }
        callback({
            totalValue: totalValue
        });
    }

    function isStepType(fullStepName, type) {
        return (fullStepName.indexOf(type) > -1);
    }

    function determineActualStepName(pageName) {
        var stepType;
        if (isStepType(pageName, 'mer')) {
            stepType = 'merch';
        } else if (isStepType(pageName, 'mag')) {
            stepType = 'magazines';
        } else if (isStepType(pageName, 'oform')) {
            stepType = 'checkout';
        }
        return stepType;
    }

    function handleMultiPageNotifications(step) {
        Tools.log('prod', step + ' Step. Subscribing to Spectrum Global Notifications');

        // Handle Actions for Add & Removal of items to cart
        Tools.onSpectrumNotify('on-cart-item-removed', function() {
            Tools.log('prod', 'SpectrumGlobal: Cart Item Removed');
            Evergage.trackAction('spec-click-' + step + '-cart-item-removed');
        });
        Tools.onSpectrumNotify('on-cart-item-added', function() {
            Tools.log('prod', 'SpectrumGlobal: Cart Item Added');
            Evergage.trackAction('spec-click-' + step + '-cart-item-added');
        });
        Tools.onSpectrumNotify('on-fusion-product-tab-render-or-item-added', function() {
            Tools.log('prod', 'SpectrumGlobal: Fusion products rendered');
            Evergage.trackAction('spec-fusion-products-rendered');
        });

    }

    function handleEntryOrderFormNotifications() {
        Tools.log('dev', 'EoForm. Subscribing to Spectrum Global Notifications');
        Tools.onSpectrumNotify('on-spectrum-form-submit', function() {
            Tools.log('dev', 'SpectrumGlobal: Form Submission on EoForm Step.');
            handleEntryOrderFormSubmission(SpectrumUtils.GetCart());
        });
    }

    function handleEntryOrderFormSubmission(cartObject) {

        var cart = cartObject.Items,
            isOrderOnly = (cart.length == 0),
            isOrderEntry = (cart.length > 0);

        if (isOrderOnly) {
            Evergage.trackAction('Spec-Click-Continue-EntryOnlyButton');
        } else if (isOrderEntry) {
            calculateTotalCartValue(cart, function(order) {
                Tools.log('dev', 'Order received from handling. Total Value: ' + order.totalValue);
                Evergage.purchase(order);
            });
        }

    }

    // Called from property tracking stack

    API.handleSpectrumRevenue = function(data) {
        var realSpectrumPageName = determineActualStepName(SpectrumUtils.GetPageName().toLowerCase());
        switch (realSpectrumPageName) {
            case 'merch': // invoked by question experience of container campaign
                // handleMerchNotifications();
                handleMultiPageNotifications(realSpectrumPageName);
                break;
            case 'magazines':
                // handleMagNotifications();
                handleMultiPageNotifications(realSpectrumPageName);
                break;
            case 'checkout':
                collectCartSize();
                handleEntryOrderFormNotifications();
                break;
        }
    };

    return API;

})();

// Track Daily Gameplay Progress
var ProgressTracker = (function() {

    var API = {};

    API.LottoCardProgress = function() {
        if (Tools.isMainPropMobileDevice()) {
            Tools.collectMultipleFields({
                pchLotto_currentCard: ajq('.card-indicator').text().trim().split(' ')[0],
                pchLotto_totalCards: ajq('.card-indicator').text().trim().split(' ')[2]
            });
        } else if (!Tools.isMainPropMobileDevice()) {
            Tools.collectMultipleFields({
                pchLotto_currentCard: ajq('.path-progress>span:eq(0)').text().trim(),
                pchLotto_totalCards: ajq('.path-progress>span:eq(1)').text().trim()
            });
        }
    };

    API.BonusGames = function() {

        if (ajq('#progress_bonus').length === 0) return;

        // Click flag vars
        var gameNumber,
            gamePlayed;
        // returns each click completion flag so we can check them for 'played class'
        var bonus10kGameFlags = ajq('#progress_bonus>.prog_left>ul>li'),
            bonus20kGameFlags = ajq('#progress_bonus>.prog_right>ul>li');
        // These two boolean type values are set with the return of .hasClass on page load
        var bonusLocked10kPlayed = ajq('#progress_bonus>.prog_left').hasClass('bonusplayed'),
            bonusLocked20kPlayed = ajq('#progress_bonus>.prog_right').hasClass('bonusplayed');
        // 'total' is incremented to either 5 or 7
        var bonusGames = {
            bonus10k: {
                total: 0,
                complete: bonusLocked10kPlayed
            },
            bonus20k: {
                total: 0,
                complete: bonusLocked20kPlayed
            },
            superPrizeEntry: false,
            complete: false
        };
        // Check each 10k bonus game flag for 'played' status 
        bonus10kGameFlags.each(function() {
            gameNumber = ajq(this).find('span').text();
            gamePlayed = ajq(this).hasClass('played');
            if ((ajq(this).hasClass('0') || ajq(this).hasClass('mg_1')) && ajq(this).hasClass('played')) {
                bonusGames.superPrizeEntry = true;
            }
            if (gameNumber != null && gamePlayed === true) {
                bonusGames.bonus10k.total++;
            }
        });
        // Check each 10k bonus game flag for 'played' status 
        bonus20kGameFlags.each(function() {
            gameNumber = ajq(this).find('span').text();
            gamePlayed = ajq(this).hasClass('played');
            if (gameNumber != null && gamePlayed === true) {
                bonusGames.bonus20k.total++;
            }
        });
        if (bonusLocked10kPlayed === true && bonusLocked20kPlayed === true) {
            bonusGames.complete = true;
        }
        // Load fields into first event data
        Tools.collectMultipleFields({
            pchcom_superPrizeEntryToday: bonusGames.superPrizeEntry,
            pchcom_bonus10k_completions: bonusGames.bonus10k.total,
            pchcom_bonus20k_completions: bonusGames.bonus20k.total,
            pchcom_bonus10klocked_complete: bonusGames.bonus10k.complete,
            pchcom_bonus20klocked_complete: bonusGames.bonus20k.complete,
            pchcom_bonusGamesCompleted: bonusGames.complete
        });

    };

    API.FrontPageProgressTracker = function() {

        var bonusNumber,
            bonusUnlocked,
            bonusStatus = {
                flags: 0,
                complete: ajq('.bottom-area-bonus-game-complete').hasClass('show')
            };

        var bonusFlags = ajq('.prog_left>ul>li');

        bonusFlags.each(function() {

            bonusNumber = ajq(this).find('span').text();
            bonusUnlocked = ajq(this).hasClass('played');
            if (bonusNumber != null && bonusUnlocked === true) {
                bonusStatus.flags++
            }

        });

        Tools.collectMultipleFields({
            frontPage_bonus_progress: bonusStatus.flags,
            frontPage_bonus_complete: bonusStatus.complete
        });

    };

    return API;

})();

