var GoogleIntegration = (function() {

    var CONFIG = {

        // config for when we need to create GA for them
        siteRequiresGACreate: false,
        gaTrackingId: 'GA_TRACKING_ID_IF_REQUIRED',

        // adjust these to modify how long we'll search for the GA functions after initializing
        listenerTimeout: -1,
        timeoutCounter: 0,

        /*
         * event types
         */

        // named page events from URLs that are mapped to actions 
        sendPageLoadEvents: false,
        // standard action events from _aaq or Evergage.trackAction, includes page click events
        sendPageActionEvents: true,
        // campaign / experience events – sends events for both control and test impressions.
        sendImpressionEvents: true,

        // category name options
        includeDatasetNameWithCategory: false, // 'Evergage_engage'
        includeAccountNameWithCategory: false, // 'Evergage_us' - if both of these are true: Evergage_us_engage

        // event name/type options etc
        eventCategory: 'Evergage', // Where is the event coming from? 
        controlImpression: 'controlImpression',
        testImpression: 'testImpression',
        pageLoadEvent: Tools.defineProperty() + '_pageLoad',
        pageActionEvent: Tools.defineProperty() + '_pageAction'

    };

    var googleAnalyticsEventFunctions = [],
        googleAnalyticsObjectCreated = false,
        conf;

    // simplify the options down and make neccesary modifications to the category name
    (function() {
        conf = CONFIG;
        if (conf.includeAccountNameWithCategory) {
            var accountName = Evergage.getAccount();
            conf.eventCategory += '_' + accountName;
        }
        if (conf.includeDatasetNameWithCategory) {
            var datasetName = Evergage.getDataset();
            conf.eventCategory += '_' + datasetName;
        }
    })();

    // Utilities

    function isPageLoadEvent(eventData) {
        for (var i = 0; i < eventData.length; i++) {
            if (eventData[i].name === ".pv") {
                return true;
                break;
            }
        }
        return false;
    }

    function createGAIfNeeded() {
        if (siteRequiresGACreate !== false && googleAnalyticsObjectCreated === true) {
            return;
        }

        var GAs = ga.getAll();
        for (var i = 0; i < GAs.length; i++) {
            var existingTrackingId = GAs[i].b.data.values[":trackingId"];
            if (existingTrackingId === trackingId) {
                ga("create", trackingId);
                googleAnalyticsObjectCreated = true;
                break;
            }
        }
    }

    function trackGoogleAnalyticsEvent(eventFunction) {
        if (typeof window.ga !== "function") {
            googleAnalyticsEventFunctions.push(eventFunction);
            if (conf.listenerTimeout === -1) {
                conf.listenerTimeout = Evergage.safeTimeout(searchForGAOnPage, 200);
            }
        } else {
            createGAIfNeeded();
            ga(eventFunction);
        }
    }

    function searchForGAOnPage() {
        if (typeof window.ga === "function") {
            sendStoredGAEvents();
        } else {
            conf.timeoutCounter++;
            if (conf.timeoutCounter < 25) {
                conf.listenerTimeout = Evergage.safeTimeout(searchForGAOnPage, 200);
            }
        }
    }

    function sendStoredGAEvents() {
        for (var i = 0; i < googleAnalyticsEventFunctions.length; i++) {
            trackGoogleAnalyticsEvent(googleAnalyticsEventFunctions[i]);
        }
    }

    // Event Type Handling

    function handlePageLoadEvents() {
        if (evergageLog.shouldLog("INFO")) console.log('Evergage: [GA] Waiting to handle tracking named page load events.');
        Evergage.addActionListener(function(actionName, eventParameters) {
            if (isPageLoadEvent(eventParameters) && actionName !== null) {

                var pageLoadEvent = {
                    hitType: "event",
                    eventCategory: conf.eventCategory,
                    eventAction: conf.pageLoadEvent,
                    eventLabel: actionName
                };

                if (window._gaq) {
                    if (evergageLog.shouldLog("INFO")) console.log('Evergage: [GA] Tracking Page Load Event: ', pageLoadEvent);
                    window._gaq.push(['_trackEvent', conf.eventCategory, conf.pageLoadEvent, actionName]);
                }


            }
        });
    }

    function handlePageActionEvents() {
        if (evergageLog.shouldLog("INFO")) console.log('Evergage: [GA] Waiting to handle page click or action events.');
        Evergage.addActionListener(function(actionName, eventParameters) {
            if (!isPageLoadEvent(eventParameters) && actionName !== null) {

                var pageActionEvent = {
                    hitType: "event",
                    eventCategory: conf.eventCategory,
                    eventAction: conf.pageActionEvent,
                    eventLabel: actionName
                };

                if (window._gaq) {
                    if (evergageLog.shouldLog("INFO")) console.log('Evergage: [GA] Tracking Page Action Event: ', pageActionEvent);
                    window._gaq.push(['_trackEvent', conf.eventCategory, conf.pageActionEvent, actionName]);
                }

            }
        });
    }

    function handleImpressionEvents() {
        if (evergageLog.shouldLog("INFO")) console.log('Evergage: [GA] Waiting to handle campaign/experience test/control impressions.');
        Evergage.addExperienceListener(function(experienceId, statType, message) {

            if (message.campaignState === "Testing" || message.campaignState === "Disabled") {
                return;
            }

            var statTypeWord = "";
            if (statType === "i" && message.userGroup !== "Control") {
                statTypeWord = conf.testImpression;
            }
            if (statType === "i" && message.userGroup === "Control") {
                statTypeWord = conf.controlImpression;
            }
            if (statType === "c") {
                statTypeWord = "Clickthrough";
            }
            if (statType === "d") {
                statTypeWord = "Dismissal";
            }

            var experienceEvent = {
                hitType: "event",
                eventCategory: conf.eventCategory,
                eventAction: statTypeWord,
                eventLabel: "Campaign: " + message.campaignName + " | Experience: " + message.experienceName
            };

            if (window._gaq) {
                if (evergageLog.shouldLog("INFO")) console.log('Evergage: [GA] Tracking Campaign/Experience Event: ', experienceEvent);
                window._gaq.push(['_trackEvent', conf.eventCategory, statTypeWord, experienceEvent.eventLabel]);
            }

        });
    }

    return {
        init: function() {
            if (evergageLog.shouldLog("INFO")) console.log('Evergage: [GA] Initializing Google Analytics Integration');
            if (conf.sendPageLoadEvents) handlePageLoadEvents();
            if (conf.sendPageActionEvents) handlePageActionEvents();
            if (conf.sendImpressionEvents) handleImpressionEvents();
        }
    };

})();


