// Spectrum Speed Swipe / Scroll API
var SpeedScrollUtility = (function() {

    var API = {};

    // Set swipe and swipe level
    function trackSpeedSwipe(swipeLevel) {
        var swipeAction = 'spectrum_speed_swipe_level_' + swipeLevel;
        Tools.log('prod', swipeAction);
        // Evergage.setCustomField('spectrum_speed_swipe_level', swipeLevel , Evergage.Scope.Request);
        if (ajq('#evergage-tooltip-ambn02ff').length === 0) {
            Evergage.trackAction(swipeAction);
        }

    }

    var ScrollSpeedMonitor = (function() {

        var self = this;

        function ScrollSpeedMonitor(callbackMethod) {
            callback = callbackMethod;

            $(window).scroll(function(e) {
                var scrollTop = $(this).scrollTop();
                didScroll(e.timeStamp, scrollTop);
            });
        }

        var callback;
        var direction = 'unknown';
        var lastDate = -1;
        var lastScrollTop = -1;

        this.thisMinimumTrackingDelayInMs = 25;

        function didScroll(timeStamp, scrollTop) {

            if (lastDate + self.thisMinimumTrackingDelayInMs <= timeStamp) {
                var offset = Math.abs(scrollTop - lastScrollTop);
                var direction = getDirection(scrollTop);
                var delayInMs = timeStamp - lastDate;
                var speedInPxPerMs = offset / delayInMs;

                if (speedInPxPerMs > 0) {
                    callback(speedInPxPerMs, timeStamp, direction);
                }

                lastDate = timeStamp;
            }

        };

        function getDirection(scrollTop) {

            var currentScrollTop = lastScrollTop;
            lastScrollTop = scrollTop;

            if (currentScrollTop > -1) {
                if (currentScrollTop >= scrollTop) {
                    return 'down';
                }
                return 'up';
            }
            return 'unknown';

        }

        function reset() {

            direction = 'unknown';
            lastDate = -1;
            lastScrollTop = -1;

        }

        return ScrollSpeedMonitor;

    }());

    API.handleMobile = function(speedLimit) {

        window.evg_speedSwipes = 0;

        var mobileScrollSpeedMonitor = new ScrollSpeedMonitor(function(speedInPxPerMs, timeStamp, newDirection) {
            var mobileScrollSpeed = Math.round(speedInPxPerMs);
            console.log(mobileScrollSpeed);
            if (mobileScrollSpeed > speedLimit) {
                Tools.log('dev', 'Speed scroll detected, you were traveling more than ' + speedLimit + ' pixels per millisecond. License and registration please.');

                window.evg_speedSwipes++;

                if (evg_speedSwipes === 12) {
                    trackSpeedSwipe(evg_speedSwipes);
                    window.evg_speedSwipes = 0;
                } else if (evg_speedSwipes === 9) {
                    trackSpeedSwipe(evg_speedSwipes);
                } else if (evg_speedSwipes === 6) {
                    trackSpeedSwipe(evg_speedSwipes);
                } else if (evg_speedSwipes === 3) {
                    trackSpeedSwipe(evg_speedSwipes);
                }
            }

        });

    };

    API.handleDesktop = function(speedLimit) {
        var desktopScrollSpeedMonitor = new ScrollSpeedMonitor(function(speedInPxPerMs, timeStamp, newDirection) {
            var desktopScrollSpeed = Math.round(speedInPxPerMs);
            // Tools.log('prod','Scroll speed: ' + desktopScrollSpeed);
            console.log(desktopScrollSpeed);
            if (desktopScrollSpeed > speedLimit) {
                Tools.log('dev', 'Speed scroll detected, you were traveling more than ' + speedLimit + ' pixels per millisecond. License and registration please.');
                if (ajq('#evergage-tooltip-ambkPb4o').length === 0) {
                    Evergage.trackAction('spec-system-scroll-detect-desktop-fast');
                }
            }
        });
    };

    return API;

})();

var SpeedUsageDetection = (function() {

    var API = {};

    var minimumTime;

    var thresholdPassed = false,
        thresholdTimer;

    function setupThresholdTimer() {
        Tools.log('prod', '[SpeedUsage] Starting ' + minimumTime + 'ms countdown...');
        thresholdPassed = false;
        thresholdTimer = setTimeout(function() {
            Tools.log('prod', '[SpeedUsage] ' + minimumTime + 'ms exceeded.');
            thresholdPassed = true;
        }, minimumTime);
    }

    function checkThresholdTimer(callback) {

        clearTimeout(thresholdTimer);

        if (thresholdPassed === false) {
            Tools.log('prod', 'Threshold was not met, tracking speed usage action.');
            // restart the timer.
            setupThresholdTimer();
            callback();
        } else {
            Tools.log('prod', 'Threshold met, not doing anything.');
        }
        // restart the timer.
        setupThresholdTimer();

    }

    API.mobile = function(threshold) {
        minimumTime = threshold;

        setupThresholdTimer();

        ajq('#mpNavNext>a').on({
            touchend: function() {
                checkThresholdTimer(function() {
                    Evergage.trackAction('spectrum_speed_swipe_level_6');
                });
            }
        });
    };

    API.desktop = function(threshold) {
        minimumTime = threshold;

        setupThresholdTimer();

        ajq('#mpNavNext>a').on({
            click: function() {
                checkThresholdTimer(function() {
                    Evergage.trackAction('spec-system-scroll-detect-desktop-fast');
                });
            }
        });
    };

    return API;

})();

